import React, { Component } from 'react';
import createHistory from 'history/createBrowserHistory';
import ProfileCard from '../../components/ProfileCard';
import Space from '../../components/Space';
import PageDefault from '../PageDefault';
import axios from 'axios';

class Listagem extends Component {
    constructor(props){
        super(props);

        this.data = [];

        let history = createHistory();
        let data = history.location.state;
        for(let i in history.location.state){
            this.data.push(data[i]);
        }
        console.log(this.data)
    }

    handleClick = (idUser) =>{
        console.log(idUser);
        const userData = axios.get('http://localhost:3001/perfil/' + idUser);
        const posts = axios.get('http://localhost:3001/' + idUser + '/publicacoes');

        console.log(userData.response)
        console.log(posts)
        // axios.all([userData,posts]).then(axios.spread((...responses) => {
        //     const dataOne = responses[0]
        //     const dataTwo = responses[1]
        // }))

    }

    render() {
        // this.componentDidMount();
        return (
            <>
            <PageDefault>
            <h1>Busca por profissionais...</h1>
            {this.data.map(data => (
                <>
                    <ProfileCard
                        src="https://obracertaupload.s3.amazonaws.com/f9f02e7a-142f-4223-ac63-3987dd1c16db-photo%20perfil.jpg"
                        title={data.nomeCompleto}
                        description={data.descricao}
                        href="/putaria"
                        onClick={() => {this.handleClick(data.idUsuario)}}
                    />
                    <Space/>
                </>
          ))}
            </PageDefault>
            </>
        );
    }
}

export default Listagem;
